#@title vectorize
# Returns an object that acts like pyfunc, but takes arrays as input

def random_operation(x):
  if x %2 ==0:
    x=x+2
  else:
    x=x-2
  return x

random_operation(a) # numpy array cannot be passed as an input to a python function like lists

func=np.vectorize(random_operation)

func

func(a)

